import React from "react";

const Main = () => {
  return (
    <>
      <div className="timelineContainer">
        <div className="Timeline"></div>
        <section className="school">
          <div>
            <h2>2014 - 2016</h2>
            <h4>BEP & BAC Pro</h4>
            <p>Gestion des milieux Naturels et de la Faune</p>
          </div>
          <img src="./icons/diploma.png" alt="Icone de diplome" />
        </section>
      </div>
    </>
  );
};

export default Main;
